import { Injectable } from '@angular/core';
export type GameSourceType={
  name?:string,
  power?:any ,
  img?:string
}
@Injectable({
  providedIn: 'root'
})
export class ReduxService {
  Game:GameSourceType[]=[{
    name:"vigita",
    power:300,
    img:'data:image/jpeg;base64,'
  },
  {
    name:"vigita",
    power:100,
    img:'data:image/jpeg;base64,'
  },
  {
    name:"vigita",
    power:80,
    img:'data:image/jpeg;base64,'
  },
]
color:string =""
  constructor() { }
  getColor(power: number):string {
    switch (true) {
      case power>=100&&power<200:
        return "green"
        
      
        case power>=200:
        this.color="gray"
        return this.color
        
       
        case power<50:
        this.color="red"
        return this.color
      
        case power>50&&power<100:
        this.color="orange"
        return this.color
      
    
      default:
      return''
    }
    
  }
}
